import React, {Component} from 'react';

let axios = require("axios").default;

let info = async()=>{
    const response = await fetch('https://swapi.dev/api/');
    return await response.json();
}

export default class Content extends Component {

    render() {
        return (

            `${info}`

        );
      }
}
